import React from 'react';
import './App.css';
import HomePage from './pages/homepage/homepage-component';
import {Route} from 'react-router-dom';


const HatsPage= () => (
  <div>
    <h1>Hats</h1>
  </div>
)

function App() {
  return (
    <div className="App">
      <Route path = '/' component = {HomePage}/>
    </div>
  );
}

export default App;
